import Link from "next/link";

const App = () => (
    <div>
        <h1>Hello World</h1>
        <p>Hello everywone, this is text in a paragraph tag that is rendered in the page source!</p>
        <Link href="/home">
          <a>Home Page</a>
        </Link>
    </div>
);

export default App;
